import React from "react";
import NavBar from "../Components/NavBar";

const Home = () => {
  return (
    <div className="bg-blue-500 w-screen h-screen">
      <div className="bg-green-500 w-screen h-12">
        <NavBar />
      </div>
      <div className="bg-green-800 w-screen h-[500px]"></div>
      <div className="bg-orange-500 w-screen h-24"></div>
      <div className="bg-orange-800 w-screen h-[360px]"></div>
    </div>
  );
};

export default Home;
